import React from 'react';

const Contact = () => {
    return(
        <>
            <section className='Previousshow' id='Previousshow'>
                <div className='container'>
                    <div className='row'>
                        <div className='col-md-6'></div>
                        <div className='col-md-6'>
                            <div className='footer-map'>
                                footer
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}
export default Contact
